const handleApiLoaded = (map, maps) => {
    const triangleCoords = [
      { lat: 51.52, lng: -0.126389 }, // top
      { lat: 51.486512, lng: -0.156998 }, // left
      { lat: 51.503515, lng: -0.112637 }, // right
      { lat: 51.52, lng: -0.126389 }, // top
    ];
  
     const bermudaTriangle = new maps.Polygon({
      paths: triangleCoords,
      strokeColor: '#FF0000',
      strokeOpacity: 0.8,
      strokeWeight: 2,
      fillColor: '#FF0000',
      fillOpacity: 0.35,
    });
    bermudaTriangle.setMap(map);
  };

module.exports = handleApiLoaded;

